/// <reference types="node" />
import { ClientRequest } from "http";
import { Url } from "url";
import { Response } from "request";
export interface DomoResponse extends Response {
    statusCode: number;
    req: DomoClientRequest;
}
export interface DomoRequestError {
    statusCode: number;
    message: string;
    method: string;
    url: string | Url;
    failureMessage: string;
}
export interface DomoClientRequest extends ClientRequest {
    method: string;
}
export interface DevToken {
    'X-Domo-Developer-Token': string;
}
export interface DomoSIDHeader {
    'X-Domo-Authentication': string;
}
